DROP TABLE IF EXISTS `car`;

CREATE TABLE `car` (
  `Descrip` varchar(15000) DEFAULT NULL,
  `Make` varchar(20) NOT NULL,
  `Model` varchar(20) NOT NULL,
  `make_year` int NOT NULL,
  `Upper_odometer_val` int NOT NULL,
  `Lower_odometer_val` int NOT NULL,
  `Price` int NOT NULL,
  `Body_type` varchar(20) DEFAULT NULL,
  `Fuel_type` varchar(20) DEFAULT NULL,
  `Payment_method` varchar(20) DEFAULT NULL,
  `Cond` varchar(20) DEFAULT NULL,
  `Color` varchar(15) DEFAULT NULL,
  `Transmission_type` varchar(15) DEFAULT NULL,
  `Virtual_tour_availability` varchar(15) DEFAULT NULL,
  `AD_ID` int NOT NULL,
  `Location` varchar(50) NOT NULL,
  `Title` varchar(100) NOT NULL,
  `Date_posted` varchar(25) NOT NULL,
  `Engine_Capacity_from` varchar(20) DEFAULT NULL,
  `Engine_Capacity_to` varchar(20) DEFAULT NULL,
  `Owner_Phone_number` varchar(20) NOT NULL,
  PRIMARY KEY (`AD_ID`),
  KEY `Owner_Phone_number` (`Owner_Phone_number`),
